import React from 'react';
import { Link } from 'react-router-dom';


const Header = () => {
    return (
        <div className="ui secondary pointing menu">
            <Link to="/" className="item">
                Demo App
            </Link>
            <div className="ui secondary pointing menu">
                <Link to ="/PostList" className="item">
                 PostList
                </Link>
                <div className="ui secondary pointing menu">    
                <Link to ="/PostList" className="item">
                 PostList
                </Link>
                </div>
            </div>
        </div>

    );
};
export default Header;
